import React from 'react';

class App extends React.Component {
  render() {
    return (
      <html>
        <form id='form1'>
            <h1 style={{color:'blue', marginLeft:200}}>Try my Demo (Named Entity Recognition)</h1>
            <div style={{marginLeft:250}}>
              <p>Enter A Text:</p>
              <textarea rows="10" cols="100" name="comment" form="usrform">
              Enter text here...</textarea>
            </div>
        </form>
        <button style={{marginLeft:250}} type="submit" form="form1" value="Submit">Submit</button>
      </html>
    );
  }
}

export default App;
